@Component({
  templateUrl: './generate-qr.html',
  styleUrls: ['./generate-qr.component.css']
})
export class GenerateQrModalAcceptorPoint implements OnInit {

  qrImage: string | ArrayBuffer;
  qrUrl: string;
  qrGenerationFailed: boolean = false;
  qrGenerationLoading: boolean = false;
  qrGenerationMsg: string;
  public amount: number;

  constructor(private sanitizer: DomSanitizer, private gipService: GipService, public activeModal: NgbActiveModal) {

  }

  ngOnInit(): void {
    $('#qrcode').hide()
  }

  send() {
    console.log('AMOUNT   ', this.amount)
    if (this.amount == undefined) {
      this.qrGenerationFailed = true;
      this.qrGenerationMsg = "Invalid amount"
    }

    $('#qrcode').hide()
    this.qrGenerationFailed = false;
    this.qrGenerationLoading = true;
    this.gipService.generateQRAcceptorPoint(GenerateQrComponent.requestData, this.amount).subscribe(
      data => {
        data.body['text']().then((val) => {
          try {
            JSON.parse(val);
            this.qrGenerationFailed = true;
          } catch {
            this.createImageFromBlob(data.body);
          }
        })
      },
      err => {
        this.qrGenerationLoading = false;
        this.qrGenerationFailed = true;
        this.qrGenerationMsg = "QR Code generation failed"
      },
      () => {
        this.qrGenerationLoading = false;
      }
    );
  }

  close() {
    this.activeModal.dismiss();
  }

  createImageFromBlob(image: Blob) {
    let reader = new FileReader();
    reader.addEventListener("load", () => {
      this.qrImage = reader.result;
      this.qrUrl = this.sanitizer.bypassSecurityTrustStyle(`url(${this.qrImage})`) as string;
      console.log(this.qrImage);
      if (this.qrImage != null)
        $('#qrcode').show()
    }, false);
    this.qrImage == null;
    if (image) {
      reader.readAsDataURL(image);
    }
  }

  download() {
    const doc = new jsPDF();

    const pageWidth = doc.internal.pageSize.width || doc.internal.pageSize.getWidth();

    const ghqr_base64 = 'data:image/png;base64,';
    const unionpay = `data:image/png;base64,`;
    const mastercard = 'data:image/png;base64,';
    const visa = 'data:image/png;base64,';
    const ecobank = 'data:image/png;base64,';

    let template = $('#template').val();
    console.log(template);

    //unit: mm
    if (template == "A4") {
      const doc = new jsPDF({ compress: true });//compression from 9.1MB to 220KB

      const pageWidth = doc.internal.pageSize.width || doc.internal.pageSize.getWidth();

      console.log('Company name' + GenerateQrComponent.requestData.companyName)
      doc
        .addImage(ghqr_base64, 'PNG', 10, 0, 38, 25)
        .line(0, 25, 280, 25)
        .setFontSize(18)
        .text(GenerateQrComponent.requestData.companyName + ' - ' + GenerateQrComponent.requestData.acceptorPointName, pageWidth / 2, 40, { 'align': 'center', 'maxWidth': 128 })
        .addImage(this.qrImage, 'JPEG', 4, 60, 140, 140)
        .setFontSize(12)
        .text('ID:' + GenerateQrComponent.requestData.acceptorPointId, 72, 200, { 'align': 'center' })
        .addImage(visa, 'PNG', 145, 70, 48, 24)
        .text('ID:' + GenerateQrComponent.requestData.visa, 144, 96, { 'maxWidth': 56 })
        .addImage(mastercard, 'PNG', 145, 113, 48, 36)
        .text('ID:' + GenerateQrComponent.requestData.mastercard, 144, 155, { 'maxWidth': 56 })
        .addImage(unionpay, 'PNG', 145, 170, 48, 24)
        .text('ID:' + GenerateQrComponent.requestData.unionpay, 144, 200, { 'maxWidth': 56 })
        .setFillColor(255, 0, 0)
        .rect(0, 225, 280, 40, 'F')
        .setFontSize(72)
        .setFont('Helvetica', 'Bold')
        .setTextColor(255, 255, 255)
        .text('SCAN AND PAY', pageWidth / 2, 255, 'center')
        .addImage(ecobank, 'PNG', 10, 270, 40, 20)
        .save('Qr' + GenerateQrComponent.requestData.acceptorPointId + '.pdf');
    }
    else if (template == "A5") {
      const doc = new jsPDF({ orientation: 'p', unit: 'mm', format: 'a5', compress: true }); //compression from 9.1MB to 220KB

      const pageWidth = doc.internal.pageSize.width || doc.internal.pageSize.getWidth();

      doc
        .addImage(ghqr_base64, 'PNG', 5, 0, 30, 20)
        .line(0, 20, 280, 20)
        .setFontSize(14)
        .text(GenerateQrComponent.requestData.companyName + ' - ' + GenerateQrComponent.requestData.acceptorPointName, pageWidth / 2, 30, { 'align': 'center', 'maxWidth': 128 })
        .addImage(this.qrImage, 'JPEG', 4, 40, 96, 96)
        .setFontSize(10)
        .text('ID:' + GenerateQrComponent.requestData.acceptorPointId, 50, 140, { 'align': 'center' })
        .addImage(visa, 'PNG', 105, 50, 30, 15)
        .text('ID:' + GenerateQrComponent.requestData.visa, 100, 70, { 'maxWidth': 44 })
        .addImage(mastercard, 'PNG', 105, 82, 30, 20)
        .text('ID:' + GenerateQrComponent.requestData.mastercard, 100, 107, { 'maxWidth': 44 })
        .addImage(unionpay, 'PNG', 105, 120, 30, 15)
        .text('ID:' + GenerateQrComponent.requestData.unionpay, 100, 140, { 'maxWidth': 44 })
        .setFillColor(255, 0, 0)
        .rect(0, 155, 280, 25, 'F')
        .setFontSize(48)
        .setFont('Helvetica', 'Bold')
        .setTextColor(255, 255, 255)
        .text('SCAN AND PAY', pageWidth / 2, 175, 'center')
        .addImage(ecobank, 'PNG', 5, 190, 30, 15)
        .save('Qr' + GenerateQrComponent.requestData.acceptorPointId + '.pdf');
    }
  }
}

function removeFromArray(array: Array<any>, index) {
  array.splice(index, 1);
}